import React from 'react';
import { NavLink } from "react-router-dom";
import "../App.scss";
import "../index.scss";



const Navigation = () => {
    return (
            <div class="navigation">
                <div className="logo">
                    <NavLink style={{ textDecoration: 'none', color: '#231f20' }} to="/"><span class="slash">/</span>Jay Pardel.</NavLink>
                </div>
                <div className="links">
                    <NavLink style={{ textDecoration: 'none', color: '#231f20' }} to="/about">about</NavLink>
                    <NavLink style={{ textDecoration: 'none', color: '#231f20' }} to="/projects">projects</NavLink>
                    <NavLink style={{ textDecoration: 'none', color: '#231f20' }} to="/contact">contact</NavLink>
                </div>



            </div>

    )
}

export default Navigation;
